(43, 'CÍA MINERA CONDESTABLE', 'Se realizaron mejoras en las zonas periféricas de los colectores incluyendo la hermetización en fajas, zarandas y tolvas a fin de optimizar el funcionamiento de los colectores descritos.', 'Mala', 'Julio - Diciembre 2014', '', '<br />::proy_galeria_de_imgenes_x::4::/proy_galeria_de_imgenes_x::<br /><br />::proy_foto_principal|0|proy_galeria_de_imgenes_x::images/proyectos/43/img20140814101136.jpg::/proy_foto_principal|0|proy_galeria_de_imgenes_x::<br />::proy_foto_principal|1|proy_galeria_de_imgenes_x::images/proyectos/43/cam00801.jpg::/proy_foto_principal|1|proy_galeria_de_imgenes_x::<br />::proy_foto_principal|2|proy_galeria_de_imgenes_x::images/proyectos/43/img-20140605-00373.jpg::/proy_foto_principal|2|proy_galeria_de_imgenes_x::<br />::proy_foto_principal|3|proy_galeria_de_imgenes_x::images/proyectos/43/img-20140604-00351.jpg::/proy_foto_principal|3|proy_galeria_de_imgenes_x::<br />', 'images/proyectos/43/camerazoom-20140611152928744.jpg'),
(44, 'SIEMENS S.A.C.', 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Voluptate esse ab quibusdam nostrum aperiam officiis perspiciatis, odit asperiores, eius voluptatibus hic enim praesentium! Quod incidunt, doloremque nostrum porro ducimus cupiditate?', 'CENTRAL TERMICA SANTA ROSA', 'Octubre 2014', '', '<br />::proy_galeria_de_imgenes_x::1::/proy_galeria_de_imgenes_x::<br /><br />::proy_foto_principal|0|proy_galeria_de_imgenes_x::images/proyectos/44/img-20141023-00082.jpg::/proy_foto_principal|0|proy_galeria_de_imgenes_x::<br />', 'images/proyectos/44/img20141113175253.jpg'),
