(45, 'KALLAPA GENERACION S.A.', 'Realizamos desmontaje, limpieza de partes internas, cambio de rodamientos y montaje de: Motores eléctricos, Válvulas mecánicas, Tuberías de vapor. Inspección, Esmerilado, corte y desmontaje de tapas metálicas.', 'Chilca', 'Enero - Febrero 2015', '', '<br />::proy_galeria_de_imgenes_x::3::/proy_galeria_de_imgenes_x::<br /><br />::proy_foto_principal|0|proy_galeria_de_imgenes_x::images/proyectos/45/img20150211105419.jpg::/proy_foto_principal|0|proy_galeria_de_imgenes_x::<br />::proy_foto_principal|1|proy_galeria_de_imgenes_x::images/proyectos/45/img20150222174154.jpg::/proy_foto_principal|1|proy_galeria_de_imgenes_x::<br />::proy_foto_principal|2|proy_galeria_de_imgenes_x::images/proyectos/45/img-20150219-01052.jpg::/proy_foto_principal|2|proy_galeria_de_imgenes_x::<br />', 'images/proyectos/45/img20150206114831.jpg');
INSERT INTO `rw8sv_cck_store_form_servicios` (`id`, `descripcin_servicio`, `imagen_servicio`) VALUES
(30, '<div style="text-align: justify;">Realizamos servicios de fabricación y montaje de: Tanques según API, fajas transportadoras, celdas de flotación, tolvas metálicas, grúas puente, plataformas, chutes con forros anti desgaste, elevadores de cangilones, tijerales.</div>\r\n<div style="text-align: justify;">Memoria de cálculos, simulación por elementos finitos, desarrollo de ingeniería básica y de detalle, fabricaciones, montajes de estructuras.</div>\r\n<div style="text-align: justify;"> </div>', 'images/servicios/30/ingenieria-y-diseno2.jpg'),
(31, 'hhjhhh', 'images/servicios/31/austinengineering.png'),
(32, 'textiiiiiiiiiiii', 'images/servicios/32/edegel.jpg'),
(34, '<h2>Fabricación y montaje de tuberías (inoxidables, hdp, aleadas, acero al carbono, etc)</h2>\r\n<p>&nbsp;</p>\r\n<h2> </h2>\r\n<h2>Fabricación y montaje de estructuras metálicas y equipos (chutes, fajas transportadoras, silos de almacenamiento, zarandas vibratorias etc).</h2>\r\n<p>&nbsp;</p>\r\n<h2>Fabricación y montaje de tanques de almacenamiento.</h2>\r\n<p>&nbsp;</p>', 'images/servicios/34/montajeplantasindustriales.jpg'),
(35, '<p>Dentro de los principales tipos de mantenimiento tenemos los siguientes:</p>\r\n<h2>Mantenimiento Preventivo</h2>\r\n<p>Inspeccionamos, controlamos, conservamos y restauramos un ítem con la finalidad de prevenir, detectar o corregir defectos, tratando de evitar fallas. La frecuencia con la que se realiza este mantenimiento depende de la criticidad del equipo.</p>\r\n<p> </p>\r\n<h2>Mantenimiento Correctivo</h2>\r\n<p>Reparamos ítems con falla; es decir este mantenimiento se realiza cuand se detecta la falla o cuando ya ocurrió.</p>\r\n<p> </p>\r\n<h2>Mantenimiento Predictivo</h2>\r\n<p>Realizamos seguimiento al desgaste de una o màs piezas o componente de equipos prioritarios a travès de anàlisis de síntomas o estimación hecha por evaluación estadística, tratando de extrapolar el comportamiento de esas piezas o componentes y determinar el punto exacto de cambio.</p>\r\n<p> </p>\r\n<h2>Desarrolló en paradas de planta (disposición las 24 horas)</h2>\r\n<p> </p>', 'images/servicios/35/mantenimientosmecanicos.jpg'),
(36, '<h2>Limpieza por medio de Arenado</h2>\r\n<div style="text-align: justify;">Se basa en logra que la partícula abrasiva adquiera la energía suficiente al impactar sobre la superficie.</div>\r\n<div style="text-align: justify;">Se realiza con el equipo adecuado para acelarar la partícula la que en una corta distancia adquiere una alta velocidad. Los equipos a presión y el chorro abrasivo de alta velocidad requierennormas de seguridad y equipos de portección especialmente formulados y diseñados para estas tareas.</div>\r\n<h2>Pintado de equipos (tanques, tuberías, estructuras, equipos)</h2>\r\n<p> </p>', 'images/servicios/36/serviciogranaladopintado.jpg'),
(37, '<ul>\r\n<li><span style="font-size: 11pt;"><span style="font-family: Arial;"></span></span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Brindamos, suministro </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">e Instalación de aislamiento térmico (CALOR Y FRIO) y refractario en equipos, componentes, tuberías y </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">accesorios.</span></li>\r\n<li><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Fabricación </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">e Instalación de Paneles de Poliuretano y </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Poli estireno </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Expandido para </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Cámaras frigoríficas.</span></li>\r\n<li><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Aislamiento </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Acústico en recintos de medio y/o alto nivel de ruido</span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">.</span></li>\r\n<li><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Estudios </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">de transferencia de calor vía análisis </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">termo gráfico.</span></li>\r\n<li><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Suministro </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">y comercialización de productos refractarios, aislantes térmicos y acústicos.</span></li>\r\n</ul>', 'images/servicios/37/img20141105122453.jpg'),
(38, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Soluta ullam distinctio earum corrupti voluptates accusantium, labore et quis a, dignissimos iusto at odit fugiat eveniet porro! Possimus nisi iste, rerum.', 'images/servicios/38/servicioconsultoria.jpg'),
(39, 'Ensayos en Gammagrafía, ultrasonido, partículas magnéticas, tintes penetrantes e inspección visual.', 'images/servicios/39/servicioensayosdestructivos.jpg'),
(40, '<div style="text-align: justify;">Suministro y montaje de andamios certificados.</div>\r\n<div style="text-align: justify;"><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Disponemos </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">de una completa gama de productos para torres de aluminio como: vigas para puentes, plataformas de gran espacio, marcos con pasarela, marcos tipo arco, marcos para puerta y marcos con cuatro placas. </span></div>\r\n<div style="text-align: justify;"><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Realizamos montaje </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">de andamios (multidireccional, tubular y cimbra</span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">) en planta, nuestros </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">andamios están fabricados según normas de seguridad OSHAS,  </span><span style="font-size: 11pt; font-family: Calibri;">como consecuencia usted tendrá unos buenos andamios a la ahora de realizar su obra o proyecto ( modelo : </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">ULMA – LAYHER).</span></div>\r\n<div style="text-align: justify;"><span style="font-size: 11pt; font-family: \'Arial Narrow\';">Contamos con personal </span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">cualificado del que disponemos, con el fin de evitar accidentes y trabajar en las condiciones exigidas</span><span style="font-size: 11pt; font-family: \'Arial Narrow\';">.</span></div>', 'images/servicios/40/serviciosolucionesandamios.jpg'),
(46, '<p>Mecanizamos las tuberías según los requerimientos del cliente para su posterios armado, unión o montaje de las partes que conforman los elementos de tuberías.<img src="images/proyectos/IMG_1714.jpg" alt="IMG 1714" width="112" height="150" style="float: right;" /></p>\r\n<div>\r\n<div style="text-align: justify;"> </div>\r\n</div>\r\n<div style="text-align: justify;">\r\n<div> </div>\r\n</div>\r\n<div>\r\n<div>\r\n<p style="text-align: justify;">Realizamos las operaciones de tratamiento que permitan dejar las tuberias en la condiciones óptimas de servicio, cumpliendo las normas </p>\r\n<p style="text-align: justify;">de calidad y de prevenciòn de riesgos laborales y ambientales.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p style="text-align: justify;"><img src="images/proyectos/IMG_20140812_110629.jpg" alt="IMG 20140812 110629" width="109" height="145" />Asimismos, realizamos soldaduras sencillas con las técnicas más comunes (electroto, semiautomatica MIG-MAG, soldeo de capilaridad, por resistencia para espàrragos, </p>\r\n<div>\r\n<p style="text-align: justify;">soldeo de plásticos y sus derivados y unión con adhesivos) en distintas calidades de material de base y en las posiciones más habituales, para unir tramos de tubería.</p>\r\n</div>\r\n</div>\r\n</div>', 'images/servicios/46/imagen3.png');
