(7, 69, 'Nosotros', 'nosotros', '<p>Somos una empresa <strong>especializada en proyectos y servicios industriales con más de 8 años de experiencia en la industria</strong>. Contamos con un equipo sólido de profesionales altamente calificados, <strong>con amplia experiencia</strong> y trayectoria en los diferentes rubros lo cual ponemos a disposición de nuestros clientes.</p>\r\n<p>Tenemos la disposición para <span style="text-decoration: underline;">atender cualquier requerimiento las 24 horas del día, los 365 días del año</span>.</p>\r\n<div class="row bloque-nosotros">\r\n<div class="col-md-4"><img src="images/historia.jpg" class="img-responsive efectohover" alt="" />\r\n<h3>HISTORIA</h3>\r\n<p>A mediados del 2007 UNICONTROLS.A.C. Empezó sus labores dando soporte a prestigiosas empresas reconocidas a nivel nacional como internacional nos especializamos en el diseño, fabricación y montaje de estructuras metal mecánicas, equipos así como mantenimiento de plantas industriales. <strong>Hemos desarrollado proyectos en los sectores de Energía(centralestermoeléctricas)cementeras, refinerías,minería,fundicionesysiderúrgicas</strong>.</p>\r\n</div>\r\n<div class="col-md-4"><img src="images/mision.jpg" class="img-responsive efectohover" />\r\n<h3>MISIÓN</h3>\r\n<p><strong>Somos una empresa orientada a satisfacer las necesidades y aspiraciones de nuestros clientes</strong>, a través de un servicio de calidad, con profesionales altamente calificados y comprometidos al desarrollo sostenible de la organización.</p>\r\n</div>\r\n<div class="col-md-4"><img src="images/vision.jpg" class="img-responsive efectohover" alt="" />\r\n<h3>VISIÓN</h3>\r\n<p><strong>Ser un grupo líder en la prestación de servicios a nivel nacional e internacional</strong> consolidando las relaciones y satisfaciendo los requerimientos de nuestros clientes, capital humano y sociedad..</p>\r\n</div>\r\n</div>', '', 1, 9, '2014-12-23 00:37:05', 451, '', '2015-03-13 17:57:04', 451, 0, '0000-00-00 00:00:00', '2014-12-23 00:37:05', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"images\\/nuestra-empresa.jpg","float_fulltext":"none","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 3, '', '', 1, 1472, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
