(14, 85, 'SISTEMA INTEGRADO DE GESTION', 'sig', '<p style="text-align: justify;">El Sistema Integrado de Gestión es una apuesta indispensable que permite una gestión transversal en materias sensibles para la empresa, sus trabajadores y la sociedad. La realización de las soluciones organizativas de manera independiente una de otra, crea un sistema de dirección dividido, lo que se trata es de ver las interrelaciones para construir un sistema único de dirección en la empresa donde se vayan incorporando coherentemente las nuevas soluciones organizativas, para elevar la eficacia y la eficiencia en la toma de decisiones a corto y a largo plazo.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p style="text-align: center;"><span style="font-size: 18pt;"><strong>POLITICA DE SISTEMAS INTEGRADOS DE GESTION</strong></span><br /><img src="images/PoticaSIG002.jpg" alt="" style="display: block; margin-left: auto; margin-right: auto;" /></p>', '', 1, 9, '2014-12-23 00:37:05', 451, '', '2016-04-13 20:32:52', 451, 0, '0000-00-00 00:00:00', '2014-12-23 00:37:05', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"images\\/control-calidad.jpg","float_fulltext":"none","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2