INSERT INTO `rw8sv_rsform_forms` (`FormId`, `FormName`, `FormLayout`, `FormLayoutName`, `FormLayoutAutogenerate`, `CSS`, `JS`, `FormTitle`, `ShowFormTitle`, `Published`, `Lang`, `ReturnUrl`, `ShowThankyou`, `Thankyou`, `ShowContinue`, `UserEmailText`, `UserEmailTo`, `UserEmailCC`, `UserEmailBCC`, `UserEmailFrom`, `UserEmailReplyTo`, `UserEmailFromName`, `UserEmailSubject`, `UserEmailMode`, `UserEmailAttach`, `UserEmailAttachFile`, `AdminEmailText`, `AdminEmailTo`, `AdminEmailCC`, `AdminEmailBCC`, `AdminEmailFrom`, `AdminEmailReplyTo`, `AdminEmailFromName`, `AdminEmailSubject`, `AdminEmailMode`, `ScriptProcess`, `ScriptProcess2`, `ScriptDisplay`, `UserEmailScript`, `AdminEmailScript`, `AdditionalEmailsScript`, `MetaTitle`, `MetaDesc`, `MetaKeywords`, `Required`, `ErrorMessage`, `MultipleSeparator`, `TextareaNewLines`, `CSSClass`, `CSSId`, `CSSName`, `CSSAction`, `CSSAdditionalAttributes`, `AjaxValidation`, `ThemeParams`, `Keepdata`, `Backendmenu`, `ConfirmSubmission`, `Access`) VALUES
(3, 'Formulario de Contacto', '<h2>{global:formtitle} </h2>\r\n{error}\r\n<div class="form-group">\r\n<label for="nombreyapellidos" class="col col-md-4 control-label">{nombreyapellidos:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n<span class="input-group-addon"> <i class="fa fa-user"></i></span>\r\n{nombreyapellidos:body}\r\n</div>\r\n</div>\r\n\r\n<div class="col col-md-8 col-md-offset-4">\r\n{nombreyapellidos:validation}\r\n</div>\r\n\r\n</div>\r\n<!--Fin campo nombreyapellidos -->\r\n\r\n<div class="form-group">\r\n<label for="email" class="col col-md-4 control-label">{email:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-envelope"></i></span>\r\n{email:body}\r\n</div>\r\n</div>\r\n\r\n\r\n<div class="col col-md-8 col-md-offset-4">\r\n{email:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo email-->\r\n\r\n\r\n<div class="form-group">\r\n<label for="pais" class="col col-md-4 control-label">{pais:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-flag"></i></span>\r\n{pais:body}\r\n</div>\r\n</div>\r\n\r\n<div class="col col-md-8 col-md-offset-4">\r\n{pais:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Pais-->\r\n\r\n\r\n<div class="form-group">\r\n<label for="telefono" class="col col-md-4 control-label">{telefono:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-phone"></i></span>\r\n{telefono:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-8 col-md-offset-4">\r\n{telefono:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Telefono-->\r\n\r\n\r\n\r\n<div class="form-group">\r\n<label for="asunto" class="col col-md-4 control-label">{asunto:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa  fa-location-arrow"></i></span>\r\n{asunto:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-8 col-md-offset-4">\r\n{asunto:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Asunto-->\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div class="form-group">\r\n<label for="consulta" class="col col-md-4 control-label">{consulta:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group">\r\n{consulta:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-8 col-md-offset-4">\r\n{consulta:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Consulta-->\r\n\r\n\r\n<div class="form-group">\r\n<label for="captchaTxt32" class="col col-md-4 control-label">{seguridad:caption}</label>\r\n<div class="col col-md-8">\r\n<div class="input-group cod-seguridad">\r\n<span class="input-group-addon"><i class="fa  fa-unlock-alt"></i></span>\r\n{seguridad:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-8 col-md-offset-4">\r\n{seguridad:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Seguridad-->\r\n\r\n\r\n\r\n<div class="form-group  botones-envio">\r\n\r\n<div class="col col-md-8 col-md-offset-4">\r\n{enviar:body}\r\n</div>\r\n</div>\r\n<!--Fin campo enviar-->\r\n\r\n', 'responsive', 0, '', ' <script>\r\n $(document).ready(function(){\r\n   	$(\'.botones-envio button[type=submit]\').addClass(\'btn-primary\');\r\n   	$(\'.botones-envio button[type=reset]\').addClass(\'btn-default\');\r\n$(\'.cod-seguridad.input-group a\').addClass(\'btn btn-mini btn-success\');\r\n   });\r\n </script> ', 'Formulario de Contacto', 1, 1, 'es-ES', '', 1, '<h2>Gracias por escribirnos</h2>\r\n<p>Hola {nombreyapellidos:value},</p>\r\n<p>Gracias por escríbirnos, en breve nos pondremos en contacto con usted.</p>\r\n<p>Saludos.</p>', 0, 'Hola {nombreyapellidos:value}, gracias por ponerte en contacto con nosotros...\r\nHemos recibido tu Solicitud correctamente y en breve nos pondremos en contacto contigo.', '', '', '', '', '', '', '', 0, 0, '', 'Nombres y Apellidos: {nombreyapellidos:value}\r\nEmail: {email:value}\r\nPaís: {pais:value}\r\nTeléfono: {telefono:value}\r\nConsulta:\r\n{consulta:value}', 'operaciones@unicontrol.com.pe', 'administracion@unicontrol.com.pe', 'j.huertas@ unicontrol.com.pe', '{email:value}', '{email:value}', '{nombreyapellidos:value}', '{consulta:value}', 0, '', '', '', '', '', '', 0, '', '', '(*)', '', '\\n', 1, 'well form-horizontal', 'userForm', '', '', '', 1, '', 1, 0, 0, ''),
(4, 'Formulario de Contacto ', '<h2>{global:formtitle} </h2>\r\n{error}\r\n<div class="form-group">\r\n<div class="col col-md-12">\r\n<div class="input-group">\r\n<span class="input-group-addon"> <i class="fa fa-user"></i></span>\r\n{nombreyapellidos:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-12">\r\n{nombreyapellidos:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo nombreyapellidos -->\r\n\r\n<div class="form-group">\r\n\r\n<div class="col col-md-12">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-envelope"></i></span>\r\n{email:body}\r\n</div>\r\n</div>\r\n\r\n\r\n<div class="col col-md-12">\r\n{email:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo email-->\r\n\r\n\r\n<div class="form-group">\r\n\r\n<div class="col col-md-12">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-flag"></i></span>\r\n{pais:body}\r\n</div>\r\n</div>\r\n\r\n<div class="col col-md-12">\r\n{pais:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Pais-->\r\n\r\n\r\n<div class="form-group">\r\n<div class="col col-md-12">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa fa-phone"></i></span>\r\n{telefono:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-12">\r\n{telefono:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Telefono-->\r\n\r\n\r\n\r\n<div class="form-group">\r\n\r\n<div class="col col-md-12">\r\n<div class="input-group">\r\n<span class="input-group-addon"><i class="fa  fa-location-arrow"></i></span>\r\n{asunto:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-12">\r\n{asunto:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Asunto-->\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div class="form-group">\r\n<div class="col col-md-12">\r\n<div class="input-group consulta">\r\n{consulta:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-12">\r\n{consulta:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Consulta-->\r\n\r\n\r\n<div class="form-group">\r\n<div class="col col-md-12">\r\n<div class="input-group cod-seguridad">\r\n<span class="input-group-addon"><i class="fa  fa-unlock-alt"></i></span>\r\n{seguridad:body}\r\n</div>\r\n</div>\r\n<div class="col col-md-12">\r\n{seguridad:validation}\r\n</div>\r\n</div>\r\n<!--Fin campo Seguridad-->\r\n\r\n\r\n\r\n<div class="form-group botones-envio">\r\n\r\n<div class="col col-md-12 ">\r\n{enviar:body}\r\n</div>\r\n</div>\r\n<!--Fin campo enviar-->\r\n\r\n', 'responsive', 0, '', ' <script>\r\n $(document).ready(function(){\r\n   	$(\'.botones-envio button[type=submit]\').addClass(\'btn-primary\');\r\n   	$(\'.botones-envio button[type=reset]\').addClass(\'btn-default\');\r\n        $(\'.cod-seguridad.input-group a\').addClass(\'btn btn-mini btn-success\');\r\n   });\r\n </script> ', 'Formulario de Contacto ', 1, 1, 'es-ES', '', 1, '<h2>Gracias por escribirnos</h2>\r\n<p>Hola {nombreyapellidos:value},</p>\r\n<p>Gracias por escríbirnos, en breve nos pondremos en contacto con usted.</p>\r\n<p>Saludos.</p>', 0, 'Hola {nombreyapellidos:value}, gracias por ponerte en contacto con nosotros...\r\nHemos recibido tu Solicitud correctamente y en breve nos pondremos en contacto contigo.', '', '', '', '', '', '', '', 0, 0, '', 'Nombres y Apellidos: {nombreyapellidos:value}\r\nEmail: {email:value}\r\nPaís: {pais:value}\r\nTeléfono: {telefono:value}\r\nConsulta:\r\n{consulta:value}', 'information@oreliagroup.com.pe,jchavez@oreliagroup.com.pe', '', '', '{email:value}', '{email:value}', '{nombreyapellidos:value}', 'Formulario de Contacto desde la Web', 1, '', '', '', '', '', '', 0, '', '', '(*)', '', '\\n', 1, 'well form-horizontal', 'userForm', '', '', '', 1, '', 1, 0, 0, '');
