(33, 3, 4, 'consulta', 'Estimado señores UNICONTROL,\r\n\r\nPara expresarle nuestros cordiales saludos a nombre de VIAEXPRESA® NETWORKS (www.viaexpresa.com.pe), e informarle sobre una excelente estrategia para AHORROS en GASTOS por CAPACITACION tanto de manera interna (colaboradores) y externamente (clientes). Tal como es de su conocimiento los rigores de la Ley Laboral exigen un número considerable de horas de capacitación por cada trabajador en periodos mensuales y acumulados anuales, los que se suman en los esfuerzos del área de RRHH para potenciar la capacidades de sus trabajadores y hacerlos más rentables operativamente. Asimismo, las inversiones que realiza en capacitación a personal de sus clientes, que en la mayoría de los casos son in situ oficinas u operaciones fuera de Lima, con lo que en gastos operacionales por este concepto se convierten en considerables si usted desea alcanzar un nivel de excelencia en servicios.\r\n\r\nPara superar estos dos asuntos, le ofrecemos un CAMPUS VIRTUAL, de características:  www.intercampus.pe  lo personalizamos y se lo entregamos en 12 días. También su empresa puede publicar cursos online en esta plataforma. Quedamos de sus gratas noticias y si desea mayor información no dude en comunicarse con nosotros.\r\n\r\nAtte.\r\n\r\nIng. Johnny Laureano\r\nVIA EXPRESA NETWORKS\r\n'),
