(96, 3, 11, 'consulta', 'Estimados Señores:\r\n\r\nBuenos días, la presente es para saludarles y a la vez manifestarles que nuestra empresa TECSUR S.A. es el operador logístico para las operaciones de LUZ DEL SUR, perteneciendo ambos al consorcio estadounidense SEMPRA ENERGY, líderes mundial en infraestructura eléctrica.\r\n\r\nNuestra empresa es una de las principales distribuidoras a nivel nacional de materiales eléctricos para redes primarias, secundarias y líneas de transmisión hasta 33kv en stock,  para niveles de tension superiores será de  pedido de importación. \r\n \r\nA continuación les  presento los materiales que actualmente comercializamos para el sector  Mineria, Petróleo , Construcción y Empresas Electricas.\r\n•    Cables de aluminio AAAC sin grasa 25mm2, 35mm2, 50mm2, 70mm2, 95mm2, 120mm2, y con grasa de 35mm2, 70mm2, \r\n            120mm2, y 185mm2 en stock, en la marca ZTT. \r\n \r\n•    Cables de cobre tipo seco NYY tripolares desde 6mm2 hasta 300mm2 y unipolar de 500mm2 en la marca INDECO. \r\n \r\n•    Cables de  aluminio tipo seco NA2XY tripolares desde 70mm2 hasta 500mm2 en la marca INDECO.  \r\n \r\n.    Cables de cobre media tensión tipo N2XSY unipolares de 8.7/15Kv desde 25mm2 hasta 120mm2 y de 18/30kv. desde 50mm2  \r\n     hasta 240mm2 en la marca INDECO.\r\n \r\n.    Cables de aluminio media tensión tipo NA2XSY unipolares en 18/30Kv de 120mm2, 185mm2 y 400mm2 en la marca INDECO.\r\n \r\n.    Cables autoportantes del tipo CAAI con neutro aislado y CAAI-S con portante de acero en la marca INDECO.\r\n \r\n.    Cables de cobre desnudo de temple blando para puesta a tierra desde 25mm2 hasta 120mm2 INDECO.\r\n \r\n.    Cable de acero galvanizado para retenida y cable de guarda de 1/2”, 3/8”, 5/16” CAMESA.\r\n \r\n.    Cable  concéntrico tipo SET  2x4mm2, 3x6mm2 INDECO.    \r\n \r\n•    Aisladores de porcelana  de clases 52-3, 55-5, 56-2, 56-3, 56-4, 53-1, 53-2, 54-1, 54-2, 54-3, 54-4, 52-5, 56-5 GAMMA unico  \r\n     REPRESENTANTE en Peru. \r\n \r\n.    Aisladores soporte portabarras para 10kv y 22.9kv GAMMA. \r\n \r\n.    Aisladores poliméricos de suspension y anclaje de 15kv, 25kv y 35kv de la marca GAMMA unico REPRESENTANTE en Peru. \r\n \r\n•    Seccionadores cut out de la marca CHANCE y sus fusibles tipo K de marca KEARNEY-USA. \r\n \r\n.    Lámparas y luminarias de 70W, 150W, 250W y 400W de las marcas  PHILIPS, JOSFEL, CELSA.  \r\n \r\n•    Ferretería eléctrica para líneas aéreas, de la marca ARRUTI. \r\n \r\n•    Accesorios para líneas eléctricas como para puestas a tierra, retenidas, etc. NACIONAL. \r\n \r\n•    Accesorios para cables: Terminaciones termocontraibles, empalmes, marcadores, mantas de reparación para cables marca RAYCHEM. \r\n \r\n.    Transformadores de potencia, de distribución, de medición, de corriente, de tensión. \r\n \r\n•    Postes y crucetas y accesorios de C.A.  \r\n \r\n.    Amarres preformados de 3/16”, 3/8”, 5/16” y ½” y varillas de armar preformado de diferentes secciones en las marcas IPREL, PLP. \r\n \r\n.    Otros  \r\n \r\nPor lo tanto, ponemos a su disposición nuestro portafolio de productos como una alternativa más, para sus diferentes proyectos y área de comercializacion.\r\n \r\nAgradeciendo por la atención prestada y solicitarle la extensión de esta presentación a sus diferentes áreas de trabajo , quedo de ustedes a la espera de cualquier comunicación, \r\n \r\n \r\nAtte.\r\n\r\n \r\nIng. Víctor Gómez Alva \r\nDivisión Energía y Minería \r\nCelular  : +51 (1) 988-846-093 \r\nNextel   : 99-836*2532 \r\nEmail    : vgomez@tecsur.com.pe  \r\nWeb     : www.tecsur.com.pe\r\n\r\n \r\n \r\n \r\n'),
