(89, 7, 1, '', '2015-03-01 02:42:31', 451, 3197, '5ff7e66bb0c9f0c38bc6de062035b4eb5da7a9f1', '{"id":7,"asset_id":"69","title":"Nosotros","alias":"nosotros","introtext":"Somos una empresa especializada en proyectos y servicios industriales con m\\u00e1s de 8 a\\u00f1os de experiencia en la industria.<br \\/><br \\/>Contamos con un equipo s\\u00f3lido de profesionales altamente calificados, con amplia experiencia y trayectoria en los diferentes rubros lo cual ponemos a disposici\\u00f3n de nuestros clientes.<br \\/><br \\/>Tenemos la disposici\\u00f3n para atender cualquier requerimiento las 24 horas del d\\u00eda, los 356 d\\u00edas de a\\u00f1o.<br \\/>\\r\\n<h3>HISTORIA<\\/h3>\\r\\nA mediados del 2007 UNICONTROLS.A.C. Empez\\u00f3 sus labores dando soporte a prestigiosas empresas reconocidas a nivel nacional como internacional nos especializamos en el dise\\u00f1o, fabricaci\\u00f3n y montaje de estructuras metal mec\\u00e1nicas, equipos as\\u00ed como mantenimiento de plantas industriales. Hemos desarrollado proyectos en los sectores de Energ\\u00eda(centralestermoel\\u00e9ctricas)cementeras,refiner\\u00edas,miner\\u00eda,fundicionesysider\\u00fargicas.<br \\/>\\r\\n<h3>MISI\\u00d3N<\\/h3>\\r\\nSomos una empresa orientada a satisfacer las necesidades y aspiraciones de nuestros clientes, a trav\\u00e9s de un servicio de calidad, con profesionales altamente calificados y comprometidos al desarrollo sostenible de la organizaci\\u00f3n.<br \\/>\\r\\n<h3>VISI\\u00d3N<\\/h3>\\r\\nSer un grupo l\\u00edder en la prestaci\\u00f3n de servicios a nivel nacional e internacional consolidando las relaciones y satisfaciendo los requerimientos de nuestros clientes, capital humano y sociedad.","fulltext":"","state":1,"catid":"9","created":"2014-12-23 00:37:05","created_by":"451","created_by_alias":"","modified":"2015-03-01 02:42:31","modified_by":"451","checked_out":"451","checked_out_time":"2015-03-01 02:41:34","publish_up":"2014-12-23 00:37:05","publish_down":"0000-00-00 00:00:0