(131, 7, 1, '', '2015-03-05 22:43:22', 451, 3749, '4405c87bcbddd4ed33174d9e9c6b5f0abca4d0e2', '{"id":7,"asset_id":"69","title":"Nosotros","alias":"nosotros","introtext":"<p>Somos una empresa <strong>especializada en proyectos y servicios industriales con m\\u00e1s de 8 a\\u00f1os de experiencia en la industria<\\/strong>.\\u00a0Contamos con un equipo s\\u00f3lido de profesionales altamente calificados, <strong>con amplia experiencia<\\/strong> y trayectoria en los diferentes rubros lo cual ponemos a disposici\\u00f3n de nuestros clientes.<\\/p>\\r\\n<p>Tenemos la disposici\\u00f3n para <span style=\\"text-decoration: underline;\\">atender cualquier requerimiento las 24 horas del d\\u00eda, los 356 d\\u00edas de a\\u00f1o<\\/span>.<\\/p>\\r\\n<div class=\\"row bloque-nosotros\\">\\r\\n<div class=\\"col-md-4\\"><img src=\\"images\\/historia.jpg\\" class=\\"img-responsive efectohover\\" alt=\\"\\" \\/>\\r\\n<h3>HISTORIA<\\/h3>\\r\\n<p>A mediados del 2007 UNICONTROLS.A.C. Empez\\u00f3 sus labores dando soporte a prestigiosas empresas reconocidas a nivel nacional como internacional nos especializamos en el dise\\u00f1o, fabricaci\\u00f3n y montaje de estructuras metal mec\\u00e1nicas, equipos as\\u00ed como mantenimiento de plantas industriales. <strong>Hemos desarrollado proyectos en los sectores de Energ\\u00eda(centralestermoel\\u00e9ctricas)cementeras, refiner\\u00edas,miner\\u00eda,fundicionesysider\\u00fargicas<\\/strong>.<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\"col-md-4\\"><img src=\\"images\\/mision.jpg\\" class=\\"img-responsive efectohover\\" \\/>\\r\\n<h3>MISI\\u00d3N<\\/h3>\\r\\n<p><strong>Somos una empresa orientada a satisfacer las necesidades y aspiraciones de nuestros clientes<\\/strong>, a trav\\u00e9s de un servicio de calidad, con profesionales altamente calificados y comprometidos al desarrollo sostenible de la organizaci\\u00f3n.<\\/p>\\r\\n<\\/div>\\r\\n<div class=\\"col-md-4\\"><img src=\\"images\\/vision.jpg\\" class=\\"img-responsive efectohover\\" alt=\\"\\" \\/>\\r\\n<h3>VISI\\u00d3N<\\/h3>\\r\\n<p><strong>Ser un grupo l\\u00edder en la prestaci\\u00f3n de servicios a nivel nacional e internacional<\\/strong> consolidando las relaciones y satisfaciendo los requerimientos de nuestros clientes, capital humano y sociedad..<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>","fulltext":"","state":1,"catid":"9","created":"2014-12-23 00:37:05","created_by":"451","created_by_alias":"","modified":"2015-03-05 22:43:22","modified_by":"451","checked_out":"451","checked_out_time":"2015-03-05 22:42:27","publish_up":"2014-12-23 00:37:05","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"images\\\\\\/nuestra-empresa.jpg\\",\\"float_fulltext\\":\\"none\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_tags\\":\\"\\",\\"show_intro\\":\\"\\",\\"info_block_position\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"urls_position\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":7,"ordering":"7","metakey":"","metadesc":"","access":"1","hits":"291","me